const AppRouter = () => {
  return (
    <AuthenticationContextProvider>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/login">
          <SignedOutPage />
        </Route>
        <Route exact path="/search">
          <SearchPage />
        </Route>
        <ProtectedRoute exact path="/events">
          <MyEvents />
        </ProtectedRoute>
      </Switch>
    </AuthenticationContextProvider>
  );
};

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" component={AppRouter} />
      </Switch>
    </Router>
  );
};

export default App;
